INSERT INTO `predefinedboards_predefinedboard` VALUES ('13', 'Around the House', '854e3dcb-ef66-49ae-a7b5-be77f4942162', '0', 'This all-purpose board is really a great place to start. It covers a nice mix of general conduct, manners, chores, and homework.', '1'), ('14', 'Chores & More', 'b3cbfe92-553d-4d02-9b17-3136f27f1c1a', '1', 'Want to get things done? This board helps you focus on a range of common inside, outside, mealtime and pet care chores.', '1'), ('15', 'Manners, Please', '3f25156c-4cc8-4865-b7c6-9451ef63db21', '3', 'It’s nice to be nice, and board helps you work on polite conduct, proper language, consideration and mealtime manners.', '1'), ('16', 'On the Road', 'ce831fe5-34d3-489f-b963-333a064edde0', '4', 'This is a great “second board” to help specifically manage behavior during vacations, events, trips or any time you’re in public.', '1'), ('17', 'Study Time', '0126a69b-fb79-4c17-86b7-d337a9acfa34', '2', 'Help your kids learn how to study with a homework board that dives deep into preparation, work habits and time management.', '1'), ('18', 'Teacher\'s Helper', '6cb6eba2-80dc-4ce0-9137-b5c114868f54', '5', 'Built for the classroom, this board covers schoolwork and conduct for the whole class, or for individual student plans.', '1'), ('19', 'Around the House', '61ab3320-aa28-46a0-b09f-1754d5fc1b61', '0', '', '0'), ('20', 'Chores & More', '4024fbba-807e-48b8-8162-c664dcdaefcb', '0', '', '0'), ('21', 'Manners, Please', '8e6d7d38-694c-44b0-8d26-3838203c7cef', '0', '', '0'), ('22', 'On the Road', '5c706984-458e-4270-b57c-898a8519573f', '0', '', '0'), ('23', 'Study Time', '70a6f132-831b-4929-8a40-e03d77ef6da2', '0', '', '0'), ('24', 'Teacher\'s Helper', 'fbd7af84-efc6-4b8a-ab56-120be81630c2', '0', '', '0');
COMMIT;

